<script>
function generateRandomArray() {
  const randomArray = [];
  
  for (let i = 0; i < 10000; i++) {
    const firstIndex = Math.floor(Math.random() * 10001); // Random number from 0 to 10000
    const secondIndex = Math.floor(Math.random() * 5) + 1; // Random number from 1 to 5
    
    let thirdIndex, fourthIndex;
    
    if (secondIndex !== 1) {
      thirdIndex = 0;
      
      if (secondIndex === 2 && thirdIndex === 0) {
        fourthIndex = 1;
      } else if (secondIndex === 3 && thirdIndex === 0) {
        fourthIndex = 2;
      } else if (secondIndex === 4 && thirdIndex === 0) {
        fourthIndex = 3;
      } else if (secondIndex === 5 && thirdIndex === 0) {
        fourthIndex = 4;
      }
    } else {
      thirdIndex = Math.floor(Math.random() * 4) + 1; // Random number from 0 to 4
      
      if (secondIndex === 1 && thirdIndex === 1) {
        fourthIndex = 5;
      } else if (secondIndex === 1 && thirdIndex === 2) {
        fourthIndex = 6;
      } else if (secondIndex === 1 && thirdIndex === 3) {
        fourthIndex = 7;
      } else if (secondIndex === 1 && thirdIndex === 4) {
        fourthIndex = 8;
      }
    }
    
    const newArray = [firstIndex, secondIndex, thirdIndex, fourthIndex];
    randomArray.push(newArray);
  }
  
  return randomArray;
}
